          "caseNum": 375,
          "incidentNotes": "Rafael Mirival and Incarnacion Garcia are playing cards at a saloon. They left together. Despite the witnesses hearing \"no quarrel,\" \"Garcia came up behind Mirival, who turned, and Garcia at once struck him. Mirival… grasped Garcia's wrist, as if endeavoring to prevent a repetition of the blow. Garcia disengaged his hand and let the knife fall and then ran.\" Somehow, Garcia bests Mirivial, described as \"an old man,\" and murders him with the knife. Witness testifies Garcia disliked Mirival's wife. Then, \"During the examination a most distressing scene ensued upon the arrival of the sisters of Garcia, whose screams and cries filled the hall, and for ten minutes suspended the progress of the examination.\" Author reveals Garcia also died by being hung to the Los Gatos Bridge. During the trial for Garcia's death, however, \"only one [witness] had been able to recognize a single person upon the streets or at the bridge after the murder of Mirival, and no one knew how Garcia came to be hanged to the bridge.\" After hours of questioning, the D.A. \"gave up in despair and the jury promptly found that 'Garcia came to his death by strangulation,... and the jury is unable, from testimony, to implicate anyone in his taking off.'\"",
