          "caseNum": 454,
          "incidentNotes": "McGowan killed in \"a quarrel with some Indians.\" Some random members of the tribe were seized as hostages in demand for murderers. \"Subsequently, two of the guilty Indians [Nep and his father] were captured, and tried by a jury of some fifteen or twenty whites.\" From the Shasta Republican: \"Of course the accusation was conviction and they were sentenced to be hung to the first tree that could be reached.\" Apparently 150 Diggers present at hanging. Nep \"asked them if they intended to let the whites hang him and his father. They seconded the verdict of the whites.\" First rope was too long, and Nep did not die. \"A draw was made upon the rope and the limb broke--the Indian falling to the ground about half dead. He was again drawn up and strangled.\" A third Indian involved was jailed in Shasta, says that he shot McGowan to save his own life. \"No steps seem to have been taken toward the arrest of the parties engaged in the hanging of the Indians.\"",
