          "caseNum": 474,
          "incidentNotes": "Miss Lilly Crane was returning from a Pinafore performance at Gilroy one night when Fellom, \"a rejected suitor of the young lady, attended the Pinafore performance on the same evening, and as soon as it closed mounted his horse and rode rapidly ahead on the road she had to take to go home and laid in wait for her.\" He \"compelled\" her escort, Mr. Rue, to leave the buggy, got in, drove down the road to \"an osage orange hedge,\" where he attempted to rape (\"attempted to commit an outrage on...\") Crane. Ernest Zanetta heard Crane's screams, \"drove hastily up to her assistance. Fellom left his intended victim and fled.\" Zanetta went to sheriff. \"Ross quickly collected a posse and started in pursuit of Fellom, overtaking and capturing him within a short distance of the scene of the outrage.\" Party came across Deputy Sheriff Goss on the road to San Juan and transferred custody of Fellom to him. Fellom locked up in San Juan. \"The story... spread rapidly, and the people were so much incensed that it was deemed advisable to remove the prisoner to the County Jail at Hollister for safe keeping.\" While they were headed to Hollister, Fellom attempted to escape (\"sprang from the buggy, and mountaing a horse that happened to be near by, succeeded in escaping.\"). \"A dozen well armed men started immediately in pursuit, determined to take him, dead or alive.\" \"The latest account... is that Fellom has been lynched.... found hanging by the neck to a tree in a canyon not far from San Juan.\" Gives short bio of Fellom, who was \"a half-breed native Californian and was well known here.\" Also, he \"had escaped by the assistance of four Spaniards.\" Crane was a daughter of a lawyer in San Benito Co., and \"the only motive that could have impelled Fellom to the commission of the outrage was revenge for her refusal to accept his proposal of marriage.\"",
