          "incidentNotes": "De Roche \"assassinated\" Thomas Treloar, a miner. \"Treloar's wife was attending a ball, and he had ordered her not to dance with De Roche. She did so, however, to his great annoyance. At the hour mentioned the two men met, and De Roche shot Treloar through the head, the ball entering just below the left ear. A crowd gathered and the murderer was arrested.\" \"He was taken to jail but upon a pretext that the vigilantes intended to hang him before morning, Deputy Sheriff Joseph Farnsworth took the prisoner to his own boarding house, handcuffed. During the night De Roche mysteriously disappeared while Farnsworth was asleep. There is great indignation over the murder of Treloar and De Roche's escape, and there is talk of lynching Farnsworth.\"\n\n1-18 Follows up: Daroche[sic] is captured \"at a wood ranch six miles from Bodie.\" \"Several speeches were made by leading citizens, some in favor and others against lynching. It was finally agreed to allow him a preliminary examination before Justice Newman... which left no doubt of the prisoner's guilt.\" \"A Vigilance Committee, known as 'The Bodie 601[?],' was organized after dark...\" Daroche taken from jail by V.C. \"and conveyed to the scene of Friday morning's murder, and hanged exactly over the spot where it occurred. [illeg.] 500 men witnessed the execution. No one is dissatisfied with the result...\" Farnsworth fled to carson but was arrested and is being escorted back. \"A demand has been made by the Free Press for a complete reorganization of the police force, and unless the demand is complied with there is liable to be further trouble. A Carson dispatch says: Farnsworth... was liberated on the news that the murderer was lynched.\"",
